import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
// import { MainNav } from './components/layout/Header';
import Homepage from './views/Homepage';

function App() {
    return ( 
    <>
        <Switch>
            <Route path="/"
            exact component={Homepage}
            />
        </Switch> 
        </>
    );
}

export default App;
